// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract PriceConsumer {
    AggregatorV3Interface internal priceFeed;

    /**
     * Network: Sepolia
     * Aggregator: ETH/USD
     * Address: 0x9E37B8c45D11b86E090aEFc180CCA972f8FEc627
     * Private Key: 0x175a1e91bd0ef547c5458f9b8cb443ecb13e154e338ae7aab29a6c5f24215481
     */
    event returnValue(address contractAddress);
    constructor() {
        priceFeed = AggregatorV3Interface(0x1b44F3514812d835EB1BDB0acB33d3fA3351Ee43);
    }

    /**
     * Returns the latest price
     */
    function getLatestPrice() public returns (int) {
        (,int price,,,) = priceFeed.latestRoundData();
        emit returnValue(0x1b44F3514812d835EB1BDB0acB33d3fA3351Ee43);
        return price;
    }
}
